import React from 'react'
import Name from './Name'
const Render = () => {
    const a=['virat','rohit','dhoni']
    const b=[{name:'Shashhwath',dob:'20/05/2003'},{name:'Shishu Sharma',dob:'19/05/2003'},{name:'Sanjay Raj',dob:'10/05/2003'}]
  return (
    <div>
    <ol>
      {a.map((a1)=>
      (
        <li>{a1}</li>
      ))}
      </ol>
      <ol>
        {
            b.map((b1)=>(
                <li key={b1.name}>{b1.name} = {b1.dob}</li>
            ))
        }
      </ol>
    </div>
  )
}

export default Render
